import React from "react";
import ReactDOM from "react-dom";

function HomePage() {
    return <div>
        <nav class="navbar navbar-dark bg-primary py-3">
            <span class="navbar-text glyphicon "><h3>Home</h3></span>
            <span class="navbar-text"><h3>Add/Edit</h3></span>
            <span class="navbar-text"><h3>Log Out</h3></span>
        </nav>
    </div>
}

export default HomePage;
